import interior1 from "../../assets/images/interior/1.jpg";
import interior2 from "../../assets/images/interior/2.webp";
import interior3 from "../../assets/images/interior/3.jpg";
import Carousel from "../UI/Carousel/Carousel";
import { FollowBtn } from "../UI/followBtn/FoollowBtn";
import { Link } from "react-router-dom";

const Main_Page = () => {
  return (
    <>
      <Carousel />
      <div className="main__page">
        <div className="restoranName">
          <div className="container">
            <p className="restoran">Choko</p>
            <p className="type">Ресторан</p>
          </div>
        </div>
        <div className="p">
          <p>MENU</p>
        </div>
        <div className="container">
          <div className="points">
            <Link><div className="point"><p>Піцца</p><FollowBtn /></div></Link>
            <Link><div className="point"><p>Соки</p><FollowBtn /></div></Link>
            <Link><div className="point"><p>Коктейлі</p><FollowBtn /></div></Link>
            <Link><div className="point"><p>Алкоголь</p><FollowBtn /></div></Link>
            <Link><div className="point"><p>Вина</p><FollowBtn /></div></Link>
            <Link><div className="point"><p>Бар</p><FollowBtn /></div></Link>
          </div>
        </div>
      </div>
    </>
  );
};

export default Main_Page;
